import { useEffect, useState } from 'react';
import './App.css';

function App() {
  const url = 'https://pokeapi.co/api/v2/pokemon?limit=151';

  //COmponentDidMount
  useEffect(async () => {
    const [ pokemons, usePokemons ] = useState;
    const {results} = await fetch(url).then(Response => Response.json());
    usePokemons(results)
  });
  return (
    <div className="App">
      <h1>Ola mundo</h1>
    </div>
  );
}

export default App;
